IF DB_ID(N'DB_Supermarket') IS NULL
BEGIN
    PRINT 'Creando base de datos DB_Supermarket...';
    CREATE DATABASE DB_Supermarket;
END
GO

USE DB_Supermarket;


-- Create tables
CREATE TABLE Products (
    ProductID INT PRIMARY KEY IDENTITY(1,1),
    ProductCode VARCHAR(20) NOT NULL,
    ProductName VARCHAR(100) NOT NULL,
    Price DECIMAL(10,2) NOT NULL
);

CREATE TABLE Sales (
    SaleID INT PRIMARY KEY IDENTITY(1,1),
    ClientName VARCHAR(100) NULL,
    ProductID INT NOT NULL,
    SaleDate DATETIME NOT NULL,
    TotalCost DECIMAL(10,2) NOT NULL,
    FOREIGN KEY (ProductID) REFERENCES Products(ProductID)
);

CREATE TABLE Clients (
    ClientID INT PRIMARY KEY,
    ClientName VARCHAR(100) NOT NULL,
    Email VARCHAR(100) NOT NULL,
    PhoneNumber VARCHAR(20)
);

CREATE TABLE Suppliers (
    SupplierID INT PRIMARY KEY,
    SupplierName VARCHAR(100) NOT NULL,
    ProductSupplied VARCHAR(100) NOT NULL 
);

-- Insert Products (10 total)

-- Insert 5000 Sales 
-- Note: This uses random generation logic
-- Run this multiple times or adapt in SSMS to generate random data
DECLARE @i INT = 0;

WHILE @i < 5000
BEGIN
    DECLARE @RandomProduct INT = FLOOR(RAND() * 10) + 1;
    DECLARE @RandomName VARCHAR(100) = 
        CASE WHEN RAND() < 0.5 THEN NULL 
             ELSE 
                 CASE FLOOR(RAND() * 5)
                     WHEN 0 THEN 'Alice'
                     WHEN 1 THEN 'Bob'
                     WHEN 2 THEN 'Carlos'
                     WHEN 3 THEN 'Diana'
                     ELSE 'Emily'
                 END
        END;
    DECLARE @RandomDate DATETIME = DATEADD(DAY, -FLOOR(RAND() * 365), GETDATE());
    DECLARE @Price DECIMAL(10,2);
    SELECT @Price = Price FROM Products WHERE ProductID = @RandomProduct;
    DECLARE @Qty INT = FLOOR(RAND() * 5) + 1;
    DECLARE @Total DECIMAL(10,2) = @Price * @Qty;

    VALUES (@RandomName, @RandomProduct, @RandomDate, @Total);

    SET @i += 1;
END;



